import React from "react";
import Post from "./post";

interface FilProps {
    setPage: any;
}

const Fil: React.FC<FilProps> = ({ setPage }) => {
    const posts = [
        { id: 1, content: "Photo 1", tags: ["tacle", "odoo"] },
        { id: 2, content: "Photo 2", tags: ["glissade", "prof"] },
        { id: 3, content: "Photo 3", tags: ["inazuma", "tacle"] },
    ];

    return (
        <div>
            {posts.map((post) => (
                <Post key={post.id} idPhoto={post.id} tags={post.tags}/>
            ))}
        </div>
    );
};

export default Fil;
